Well I won't lie, I haven't read it myself.  In fact, almost no one reads the original sources for ANYTHING important.  For most people (myself included) we see certain sources as credible, and when they get excited for something, we do as well.  It's as simple as that. 

I believe that climate change is a big deal, the sources that I trust don't particularly think it has any cheap tricks up its sleeve, so therefore, I'm optimistic.  I feel like that's a reasonable opinion.  No need to call me retarded.

