@The Honest Truth 
Considering that currently, world-wide China is the biggest Greenhouse gas (GHG) polluter, I understand your frustration that the USA and Europe are paying more. However, the problem is that climate change and greenhouse gas emissions are triggered by the total amount of GHG emissions in the atmosphere. Considering the historical amounts emitted, the GHG already out there, Europe and the USA respectively have emitted 25% and 22%, compared to China with only 12.7 %. The USA and Europe have been using their historical emissions to build their current wealth and increase their standard of living. When thinking about that, it is, in my opinion, justified that the EU and USA are currently paying and doing more than China. Further, if we look at the GHG output used to produce consumer goods for the USA and Europe, most often imported from China or similar countries, the USA's and EU's GHG output is even higher. But I agree with you that also China will have to reduce its current emission if we want to prevent catastrophic climate change. I think we will have to find a way to allow developing nations to increase their standard of living and lift their population out of poverty, while still decreasing GHG emissions globally. This is the challenge for the next 30 years and I strongly believe that we need international cooperation, such as the Paris agreement to achieve this goal. Climate change as a global issue cannot be solved by an individual country. If every country only focuses on its own benefit, it is probable that the world and its societies as we know them will go down. And for me at least this is not an alternative. 

But why is climate change bad? In the last few decades, we have seen an amount of extinction of species comparable to mass extinction periods in world history. We experienced an increase in natural disasters such as hurricanes and droughts, and shifting of climate zones, allowing soon for wine production on the British isles. Why would a few degrees more change something? A few degrees present the difference between climate zones, and we don't know when we reach a point of no return triggering ecological chain reactions making damages to our environment irreversible. The earth's ecological systems are complex and we don't understand them fully, but let me ask a question: If you don't really know how to disassemble a car, would you take some screws out of the engine and hope it would not change anything or would you rather not take that risk?

